    33export default function RacketPage() {
    34  const [level, setLevel] = useState<string>('intermediate');
    35  const [style, setStyle] = useState<string>('all-round');
    36  const [weaknesses, setWeaknesses] = useState<string[]>([]);
    37  const [loading, setLoading] = useState(false);
