    46  const loadFavorites = async () => {
    47    const { data: { user } } = await supabase.auth.getUser();
    48    if (!user) return;
    49
    50    try {
    51      const { data, error } = await supabase
    52        .from('racket_favorites')
    53        .select('racket_id')
    54        .eq('user_id', user.id);
    55
    56      // Gracefully handle if table doesn't exist
    57      if (error) {
    58        console.log('Favorites not available:', error.message);
    59        return;
    60      }
    61
    62      if (data) {
