   335// Racket Card Component with image handling
   336function RacketCard({
   337  racket,
   338  index,
   339  isFavorite,
   340  onToggleFavorite,
   341  onOpenEbay,
   342}: {
   343  racket: RacketRecommendation;
   344  index: number;
   345  isFavorite: boolean;
   346  onToggleFavorite: () => void;
   347  onOpenEbay: () => void;
   348}) {
   349  const [imageError, setImageError] = useState(false);
   350  const [imageLoading, setImageLoading] = useState(true);
   351
   352  // Check if this image has already failed
   353  const hasFailedBefore = racket.image_url && failedImages.has(racket.image_url);
   354  const showImage = racket.image_url && !imageError && !hasFailedBefore;
   355
   356  const handleImageError = useCallback(() => {
   357    if (racket.image_url) {
   358      // Log the failing URL once
   359      if (!failedImages.has(racket.image_url)) {
   360        console.warn('Racket image failed to load:', racket.image_url);
   361        failedImages.add(racket.image_url);
   362      }
   363    }
   364    setImageError(true);
   365    setImageLoading(false);
   366  }, [racket.image_url]);
   367
   368  const handleImageLoad = useCallback(() => {
   369    setImageLoading(false);
   370  }, []);
   371
   372  return (
   373    <div className="bg-white rounded-xl shadow-sm overflow-hidden hover:shadow-md transition">
   374      {/* Rank Badge */}
