   379              {imageLoading && (
   380                <div className="absolute inset-0 flex items-center justify-center bg-gray-100">
   381                  <div className="animate-spin rounded-full h-8 w-8 border-b-2 border-primary-500" />
   382                </div>
   383              )}
   384              <Image
   385                src={racket.image_url!}
   386                alt={`${racket.brand} ${racket.name}`}
   387                width={192}
