   389                className={`object-contain max-h-44 transition-opacity ${imageLoading ? 'opacity-0' : 'opacity-100'}`}
   390                style={{ width: 'auto', height: 'auto' }}
   391                onError={handleImageError}
   392                onLoad={handleImageLoad}
   393                unoptimized // Use unoptimized for external eBay images
   394              />
   395            </>
   396          ) : (
   397            <span className="text-6xl"></span>
