     8import type {
     9  ShotSegment,
    10  ShotFeatures,
    11  RallyState,
    12  ShotRecommendation,
    13  PathPoint,
    14  ShotType,
    15  PerShotAnalysis,
    16  RallyAnalysisResult,
    17  RallySummary,
    18  AnalysisMetadata,
    19} from './types';
    20import type { TrajectoryPoint } from '../types';
    21import { segmentShots } from './shot-segmentation';
    22import {
    23  computeRallyState,
    24  computeAllRallyStates,
    25  positionToZone,
    26  zoneToPosition,
    27  getDominantPhase,
    28  getAveragePressure,
    29  findKeyMoments,
    30} from './rally-state-machine';
    31import { extractShotFeatures, extractAllShotFeatures } from './feature-extraction';
    32import { scoreAndRankRecommendations } from './scoring-engine';
    33import {
    34  DEBUG_FLAG,
    35  ENGINE_VERSION,
    36  VIABLE_SHOTS_BY_PHASE,
    37  SHOT_HEIGHT_PROXY,
    38  ZONE_CENTERS,
    39} from './constants';
    40
    41/**
    42 * Debug logger
    43 */
    44function logDebug(message: string, data?: unknown): void {
    45  if (DEBUG_FLAG) {
    46    console.log(`[RecommendationGenerator] ${message}`, data ?? '');
    47  }
    48}
    49
    50/**
    51 * Generate a unique recommendation ID
    52 */
    53function generateRecId(shotType: ShotType, targetZone: number): string {
    54  return `rec-${shotType}-${targetZone}-${Date.now()}-${Math.random().toString(36).substr(2, 9)}`;
    55}
    56
    57/**
    58 * Generate shot path polyline from contact point to target zone
    59 */
    60export function generateShotPath(
    61  contactPoint: { x: number; y: number },
    62  targetZone: number,
    63  shotType: ShotType
    64): PathPoint[] {
    65  const target = zoneToPosition(targetZone);
    66  const path: PathPoint[] = [];
    67
    68  // Start point
    69  path.push({
    70    x: contactPoint.x,
    71    y: contactPoint.y,
    72    z: 0.5, // Default height at contact
    73  });
    74
    75  // Generate intermediate points based on shot type
    76  const heightProxy = SHOT_HEIGHT_PROXY[shotType] ?? 0.5;
    77  const numPoints = 5;
    78
    79  for (let i = 1; i < numPoints; i++) {
    80    const t = i / numPoints;
    81
    82    // Linear interpolation for x, y
    83    const x = contactPoint.x + (target.x - contactPoint.x) * t;
    84    const y = contactPoint.y + (target.y - contactPoint.y) * t;
    85
    86    // Parabolic arc for height
    87    // Height peaks at t=0.5, varies by shot type
    88    const heightBase = 0.3;
    89    const heightPeak = heightProxy * 3; // Max height in meters
    90    const z = heightBase + heightPeak * 4 * t * (1 - t);
    91
    92    path.push({ x, y, z });
    93  }
    94
    95  // End point
    96  path.push({
    97    x: target.x,
    98    y: target.y,
    99    z: 0.2, // Landing height
   100  });
   101
   102  return path;
   103}
   104
   105/**
   106 * Get viable shot types based on rally phase and contact zone
   107 */
   108function getViableShotTypes(
   109  phase: string,
   110  contactZone: number
   111): ShotType[] {
   112  const phaseShotTypes = VIABLE_SHOTS_BY_PHASE[phase] ?? VIABLE_SHOTS_BY_PHASE.neutral;
   113
   114  // Filter based on contact zone
   115  // From back court: can play clear, smash, drop, drive
   116  // From mid court: can play drive, drop, net
   117  // From front court: can play net, push, lift
   118  const depthIdx = Math.floor(contactZone / 3);
   119
   120  if (depthIdx === 2) {
   121    // Back court
   122    return phaseShotTypes.filter(s =>
   123      ['clear', 'smash', 'drop', 'drive', 'lift'].includes(s)
   124    );
   125  } else if (depthIdx === 1) {
   126    // Mid court
   127    return phaseShotTypes.filter(s =>
   128      ['drive', 'drop', 'net', 'clear', 'push'].includes(s)
   129    );
   130  } else {
   131    // Front court
   132    return phaseShotTypes.filter(s =>
   133      ['net', 'push', 'lift', 'drive'].includes(s)
   134    );
   135  }
   136}
   137
   138/**
   139 * Build a candidate recommendation (before scoring)
   140 */
   141function buildCandidateRecommendation(
   142  shotType: ShotType,
   143  targetZone: number,
   144  contactPoint: { x: number; y: number }
   145): ShotRecommendation {
   146  const pathPolyline = generateShotPath(contactPoint, targetZone, shotType);
   147
   148  return {
   149    id: generateRecId(shotType, targetZone),
   150    shotType,
   151    targetZone,
   152    pathPolyline,
   153    score: 0, // Will be set by scoring engine
   154    rationale: [], // Will be set by scoring engine
   155    confidence: 0.75, // Will be updated by scoring engine
   156  };
   157}
   158
   159/**
   160 * Generate TOP-3 recommendations for a single shot
   161 */
   162export function generateRecommendations(
   163  shot: ShotSegment,
   164  features: ShotFeatures,
   165  rallyState: RallyState
   166): ShotRecommendation[] {
   167  logDebug(`Generating recommendations for shot ${shot.shotIndex}`, {
   168    phase: rallyState.phase,
   169    pressure: rallyState.pressure.toFixed(2),
   170    openZones: rallyState.openCourtZones,
   171  });
   172
   173  // Get contact point from shot
   174  const startPoint = shot.trajectorySlice[0] ?? { x: 0.5, y: 0.25 };
   175  const contactPoint = { x: startPoint.x, y: startPoint.y };
   176
   177  // Get viable shot types for current phase and position
   178  const viableShotTypes = getViableShotTypes(rallyState.phase, features.contactZone);
   179
   180  // Generate candidate recommendations
   181  const candidates: ShotRecommendation[] = [];
   182
   183  // Prioritize open court zones
   184  const targetZones = [
   185    ...rallyState.openCourtZones,
   186    // Add some non-open zones for variety
   187    ...Array.from({ length: 9 }, (_, i) => i).filter(
   188      z => !rallyState.openCourtZones.includes(z)
   189    ),
   190  ];
   191
   192  // Generate candidates: each viable shot type to each target zone
   193  for (const shotType of viableShotTypes) {
   194    for (const targetZone of targetZones.slice(0, 5)) {
   195      // Limit to top 5 zones
   196      candidates.push(
   197        buildCandidateRecommendation(shotType, targetZone, contactPoint)
   198      );
   199    }
   200  }
   201
   202  // Score and rank all candidates
   203  const scored = scoreAndRankRecommendations(
   204    candidates,
   205    features,
   206    rallyState
   207  );
   208
   209  // Return top 3
   210  const top3 = scored.slice(0, 3);
   211
   212  logDebug(`Generated TOP-3 recommendations`, {
   213    recs: top3.map(r => ({
   214      type: r.shotType,
   215      zone: r.targetZone,
   216      score: r.score,
   217    })),
   218  });
   219
   220  return top3;
   221}
