   223/**
   224 * Generate per-shot analysis for all shots in a rally
   225 */
   226export function generatePerShotAnalysis(
   227  shots: ShotSegment[],
   228  rallyStates: RallyState[],
   229  features: ShotFeatures[]
   230): PerShotAnalysis[] {
   231  return shots.map((shot, index) => {
   232    const state = rallyStates[index];
   233    const shotFeatures = features[index];
   234
   235    const recommendations = generateRecommendations(shot, shotFeatures, state);
   236
   237    return {
   238      shot,
   239      features: shotFeatures,
   240      recommendations,
   241    };
   242  });
   243}
