   247 */
   248function buildRallySummary(
   249  shots: PerShotAnalysis[],
   250  rallyStates: RallyState[]
   251): RallySummary {
   252  return {
   253    totalShots: shots.length,
   254    dominantPhase: getDominantPhase(rallyStates),
