   261/**
   262 * Main function: Analyze a complete rally and generate recommendations
   263 *
   264 * @param sessionId Session ID
   265 * @param trajectory Array of trajectory points
   266 * @param poseTimestamps Optional pose timestamps for fusion
   267 * @param opponentPositions Optional opponent position data
   268 * @param playerPositions Optional player position data
   269 * @returns Complete rally analysis result
   270 */
   271export function analyzeRally(
   272  sessionId: string,
   273  trajectory: TrajectoryPoint[],
   274  poseTimestamps?: number[],
   275  opponentPositions?: Array<{ x: number; y: number; timestamp: number }>,
   276  playerPositions?: Array<{ x: number; y: number; timestamp: number }>
   277): RallyAnalysisResult {
   278  const startTime = Date.now();
   279  const debugLogs: string[] = [];
   280
   281  if (DEBUG_FLAG) {
   282    debugLogs.push(`Starting analysis with ${trajectory.length} trajectory points`);
   283  }
   284
   285  // Step 1: Segment shots from trajectory
   286  const shots = segmentShots(trajectory, poseTimestamps);
   287  if (DEBUG_FLAG) {
   288    debugLogs.push(`Segmented into ${shots.length} shots`);
   289  }
   290
   291  // Handle empty trajectory
   292  if (shots.length === 0) {
   293    logDebug('No shots detected, returning empty result');
   294    return {
   295      sessionId,
   296      rallyId: `rally-${Date.now()}`,
   297      shots: [],
   298      summary: {
   299        totalShots: 0,
   300        dominantPhase: 'neutral',
   301        averagePressure: 0.5,
   302        keyMoments: [],
   303      },
   304      metadata: {
   305        processedAt: new Date().toISOString(),
   306        engineVersion: ENGINE_VERSION,
   307        processingTimeMs: Date.now() - startTime,
   308        debugLogs: DEBUG_FLAG ? debugLogs : undefined,
   309      },
   310    };
   311  }
   312
   313  // Step 2: Compute rally states for all shots
   314  const rallyStates = computeAllRallyStates(shots, opponentPositions);
   315  if (DEBUG_FLAG) {
   316    debugLogs.push(`Computed rally states: ${rallyStates.map(s => s.phase).join(', ')}`);
   317  }
   318
   319  // Step 3: Extract features for all shots
   320  const features = extractAllShotFeatures(
   321    shots,
   322    rallyStates,
   323    opponentPositions,
   324    playerPositions
   325  );
   326  if (DEBUG_FLAG) {
   327    debugLogs.push(`Extracted features for ${features.length} shots`);
   328  }
   329
   330  // Step 4: Generate per-shot analysis with recommendations
   331  const perShotAnalysis = generatePerShotAnalysis(shots, rallyStates, features);
   332
   333  // Step 5: Build rally summary
   334  const summary = buildRallySummary(perShotAnalysis, rallyStates);
   335
   336  // Build final result
   337  const result: RallyAnalysisResult = {
   338    sessionId,
   339    rallyId: `rally-${Date.now()}-${Math.random().toString(36).substr(2, 9)}`,
   340    shots: perShotAnalysis,
   341    summary,
   342    metadata: {
   343      processedAt: new Date().toISOString(),
   344      engineVersion: ENGINE_VERSION,
   345      processingTimeMs: Date.now() - startTime,
   346      debugLogs: DEBUG_FLAG ? debugLogs : undefined,
   347    },
   348  };
   349
   350  logDebug('Rally analysis complete', {
   351    totalShots: summary.totalShots,
   352    dominantPhase: summary.dominantPhase,
   353    avgPressure: summary.averagePressure.toFixed(2),
   354    keyMoments: summary.keyMoments,
   355    processingTimeMs: result.metadata.processingTimeMs,
   356  });
   357
   358  return result;
   359}
