   361/**
   362 * Generate recommendations for a specific shot in context
   363 * Useful for real-time or interactive analysis
   364 */
   365export function generateRecommendationsForShot(
   366  trajectory: TrajectoryPoint[],
   367  shotIndex: number,
   368  opponentPosition?: { x: number; y: number }
   369): ShotRecommendation[] {
   370  // Segment trajectory
   371  const shots = segmentShots(trajectory);
   372
   373  if (shotIndex < 0 || shotIndex >= shots.length) {
   374    logDebug(`Invalid shot index ${shotIndex}, returning empty recommendations`);
   375    return [];
   376  }
   377
   378  // Compute state and features for specific shot
   379  const state = computeRallyState(shots, shotIndex, opponentPosition);
   380  const previousShot = shotIndex > 0 ? shots[shotIndex - 1] : undefined;
   381  const features = extractShotFeatures(
   382    shots[shotIndex],
   383    state,
   384    previousShot,
   385    opponentPosition ? [{ ...opponentPosition, timestamp: shots[shotIndex].startTime }] : undefined
   386  );
   387
   388  return generateRecommendations(shots[shotIndex], features, state);
   389}
