    31 * Zone layout (on opponent's half, y > 0.5):
    32 * ```
    33 *   6 | 7 | 8  (back)
    34 *   3 | 4 | 5  (mid)
    35 *   0 | 1 | 2  (front)
    36 * ---- NET ----
    37 * ```
