    39export function positionToZone(x: number, y: number): number {
    40  // Determine width zone
    41  let widthIdx: number;
    42  if (x < ZONE_WIDTH_BOUNDARIES.left.max) {
    43    widthIdx = 0; // left
    44  } else if (x < ZONE_WIDTH_BOUNDARIES.center.max) {
    45    widthIdx = 1; // center
    46  } else {
    47    widthIdx = 2; // right
    48  }
    49
    50  // Determine depth zone (relative to far half-court)
    51  // For opponent's side (y > 0.5):
    52  // - front: 0.5 - 0.667
    53  // - mid: 0.667 - 0.833
    54  // - back: 0.833 - 1.0
    55  let depthIdx: number;
    56  if (y > 0.5) {
    57    // Opponent's side
    58    if (y < ZONE_DEPTH_BOUNDARIES.far.front.max) {
    59      depthIdx = 0; // front
    60    } else if (y < ZONE_DEPTH_BOUNDARIES.far.mid.max) {
    61      depthIdx = 1; // mid
    62    } else {
    63      depthIdx = 2; // back
    64    }
    65  } else {
    66    // Our side - mirror the zones
    67    if (y > ZONE_DEPTH_BOUNDARIES.near.front.min) {
    68      depthIdx = 0; // front (near net)
    69    } else if (y > ZONE_DEPTH_BOUNDARIES.near.mid.min) {
    70      depthIdx = 1; // mid
    71    } else {
    72      depthIdx = 2; // back (near our baseline)
    73    }
    74  }
    75
    76  return depthIdx * 3 + widthIdx;
    77}
