    30/**
    31 * Compute 2D velocity vector between two points
    32 */
    33function computeVelocity(
    34  p1: TrajectoryPoint,
    35  p2: TrajectoryPoint
    36): { vx: number; vy: number; magnitude: number } {
    37  const dt = Math.max(p2.timestamp - p1.timestamp, 1); // Avoid division by zero
    38  const vx = (p2.x - p1.x) / dt * 1000; // Normalize to per-second
    39  const vy = (p2.y - p1.y) / dt * 1000;
    40  const magnitude = Math.sqrt(vx * vx + vy * vy);
    41  return { vx, vy, magnitude };
    42}
