    48  v1: { vx: number; vy: number; magnitude: number },
    49  v2: { vx: number; vy: number; magnitude: number }
    50): number {
    51  const denominator = v1.magnitude * v2.magnitude + EPSILON;
    52  const dotProduct = v1.vx * v2.vx + v1.vy * v2.vy;
    53  const cosAngle = Math.max(-1, Math.min(1, dotProduct / denominator));
    54  return Math.acos(cosAngle);
    55}
